ran\n","\n","- These three lexicons make use of the unigrams. Unigrams are a type of n-gram model that consists of a sequence of 1 item, that is, a word collected from a given textual data.\n","\n","- In the AFINN lexicon model scores the words in a range from -5 to 5. The increase in negativity corresponds the negative sentiment whereas an increase in positivity corresponds the positive one. \n","- The bing lexicon model on the other hand, classifies the sentiment into a binary category of negative or positive. \n","- The loughran model that performs analysis of the shareholder’s reports. In this project, we will make use of the bing lexicons to extract the sentiments out of our data. \n","\n","#### Reference: [ScienceDirect](https://www.sciencedirect.com/science/article/abs/pii/S095741741830143X)"]},{"cell_type":"markdown","id":"9677c110","metadata":{"papermill":{"duration":0.011115,"end_time":"2024-05-20T11:42:58.473298","exception":false,"start_time":"2024-05-20T11:42:58.462183","status":"completed"},"tags":[]},"source":["# Sentiments"]},{"cell_type":"markdown","id":"ed159cc2","metadata":{"papermill":{"duration":0.009865,"end_time":"2024-05-20T11:42:58.493251","exception":false,"start_time":"2024-05-20T11:42:58.483386","status":"completed"},"tags":[]},"source":["## We can retrieve these lexicons using the get_sentiments() function. We can implement this as follows:"]},{"cell_type":"code","execution_count":4,"id":"1aadd3e2","metadata":{"execution":{"iopub.execute_input":"2024-05-20T11:42:58.517893Z","iopub.status.busy":"2024-05-20T11:42:58.515633Z","iopub.status.idle":"2024-05-20T11:42:58.592392Z","shell.execute_reply":"2024-05-20T11:42:58.590399Z"},"papermill":{"duration":0.091777,"end_time":"2024-05-20T11:42:58.595054","exception":false,"start_time":"2024-05-20T11:42:58.503277","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6786 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>word</th><th 